import "./style/index.scss"

function App() {
  return (
    <div id="burger_box">
      <ul>
        <li> <a href="index.html"> Home </a> </li>
        <li> <a href="products.html"> Products </a> </li>
        <li> <a href="about.html"> About </a> </li>
        <li> <a href="contact.html"> Contact </a> </li>
        <li> <a href="create_account.html"> Account </a> </li>
      </ul>
    </div>
  );
}

export default App;
